// import React, { useState, useEffect } from "react";
import style from "../NavBar/navbar.module.css";
import { Nav,NavDropdown,Navbar,Container } from "react-bootstrap";

import logo from '../../UI/Img/softechsolutions_logo.png'

const NavBar = () => {
  
  return (
    
    <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark" className={style.nav}>
    <Container>
    {/* <Navbar.Brand href="#home" className="brand"><img src={logo} className="brand_logo" />Softech</Navbar.Brand> */}
    <Navbar.Toggle aria-controls="responsive-navbar-nav" />
    <Navbar.Collapse id="responsive-navbar-nav">
      <Nav className="me-auto">
        <Nav.Link href="#features">Home</Nav.Link>
        <Nav.Link href="#pricing">About Us</Nav.Link>
        <Nav.Link href="#pricing">Partners</Nav.Link>
        <Nav.Link href="#pricing">Clients</Nav.Link>
        <Nav.Link href="#pricing">PortFolio</Nav.Link>
        <Nav.Link href="#pricing">Careers</Nav.Link>
        <Nav.Link href="#pricing">Contacts</Nav.Link>
        {/* <NavDropdown title="Dropdown" id="collasible-nav-dropdown">
          <NavDropdown.Item href="#action/3.1">Services</NavDropdown.Item>
          <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
          <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
          <NavDropdown.Divider />
          <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
        </NavDropdown> */}
      </Nav>
      <Nav>
        <Nav.Link href="#deets">More deets</Nav.Link>
        <Nav.Link eventKey={2} href="#memes">
          Dank memes
        </Nav.Link>
      </Nav>
    </Navbar.Collapse>
    </Container>
  </Navbar>
  );
};

export default NavBar;
